          data: [],
          filter:"",
          alert:false,
          isActive:false,
          page:1,
          query: '',
        }

      }

      componentWillMount(){
        this._refreshMovies(); 

     }
     _refreshMovies(query) {
        const {   data } = this.state;


        axios.get(URL_PATH).then(response => {
         console.log(response); 
          this.setState({
            data: response.data,

          });

        });
      }

    render() {
        const getData = this.state.data;
        return (

            <div className="container"> 
            <h3>Power Plants</h3>
            <table>
        <thead>
          <tr>
              <th>Bundesnetza gentur Number</th>
              <th>Company</th>
              <th>Type</th>
              <th>State</th>
              <th>Production Value (kW)</th>
              <th>Agg.Production (kW)</th>
          </tr>
        </thead>

        <tbody>
        {getData.map((row, i)=>(
          <tr key={i}> 
            <td>{row.bundesnetzagentur_number}</td>
            <td>{row.comapny_name}</td>
            <td>{row.type}</td>
            <td>{row.state}</td>
            <td>{row.production_value_kw}</td>
            <td>{row.aggregated_production_kw}</td>
          </tr>
          ))} 

        </tbody>
      </table>   

            </div>
        )
    }
}
